webpackJsonp([0xfb36e5980d1f],{511:function(t,n){t.exports={data:{markdownRemark:{html:'<p><strong>Tiny Atom</strong> ships with an integration to <a href="http://extension.remotedev.io/" target="_blank" rel="nofollow noopener noreferrer">Redux DevTools Extension</a>. Check out their website for instructions on how to install the browser extension.</p>\n<p>Once you have the browser extension, using the devtools is as easy as:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code><span class="token keyword">const</span> createAtom <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'tiny-atom\'</span><span class="token punctuation">)</span>\n<span class="token keyword">const</span> devtools <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'tiny-atom/devtools\'</span><span class="token punctuation">)</span>\n\n<span class="token keyword">const</span> atom <span class="token operator">=</span> <span class="token function">createAtom</span><span class="token punctuation">(</span><span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span> evolve<span class="token punctuation">,</span> render<span class="token punctuation">,</span> <span class="token punctuation">{</span> debug<span class="token punctuation">:</span> devtools <span class="token punctuation">}</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 786px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 79.42583732057416%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px #ffffff;"\n        alt="Devtools"\n        title=""\n        src="/tiny-atom/static/devtools-2a53da9f11d9c9890640d08502562313-0e19c.png"\n        srcset="/tiny-atom/static/devtools-2a53da9f11d9c9890640d08502562313-a9803.png 197w,\n/tiny-atom/static/devtools-2a53da9f11d9c9890640d08502562313-fcf18.png 393w,\n/tiny-atom/static/devtools-2a53da9f11d9c9890640d08502562313-0e19c.png 786w,\n/tiny-atom/static/devtools-2a53da9f11d9c9890640d08502562313-ab40d.png 1179w,\n/tiny-atom/static/devtools-2a53da9f11d9c9890640d08502562313-c4dff.png 1572w,\n/tiny-atom/static/devtools-2a53da9f11d9c9890640d08502562313-3f330.png 1672w"\n        sizes="(max-width: 786px) 100vw, 786px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Note: unlike the console logger (<code>tiny-atom/log</code>), devtools only lists the state updates and not the actions. In <strong>Tiny Atom</strong> - an action can cause 0 or more state updates. In devtools the action itself is not listed, only the state updates are. In devtools terminology and UI these will appear as actions. You can click on actions in devtools to find out more details about what caused this state update.</p>',excerpt:"Tiny Atom  ships with an integration to  Redux DevTools Extension . Check out their website for instructions on how to install the browserâ€¦",timeToRead:1,frontmatter:{title:"Devtools"},parent:{__typename:"File",relativePath:"devtools.md"}}},pathContext:{slug:"/devtools/"}}}});
